INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, 'Nunc sed erat ut dolor venenatis aliquet et nec urna. Nulla consectetur, magna at imperdiet vestibulum, elit arcu dapibus eros, nec lacinia velit justo in est.', 'Footer message', 'full_html'),
(2, 'Donec diam felis, scelerisque in ullamcorper eget, varius vitae lorem. Nullam elementum, justo a tempus sagittis, ligula neque blandit quam, non dapibus dolor ante sit amet purus. Mauris vel dolor velit. Sed gravida tincidunt pellentesque.', 'Slogan', 'full_html'),
