('node', 'basicpage', 0, 55, 55, 'und', 0, 'Different blocks become available when you enable certain modules. For example, with Forum module you have ''New forum topic'', with Blog module - ''Recent blog posts'' and so on.\r\n\r\nWhen you enabled a block, you can assign pages on which the block will be appearing, and also set its position on the page (header, footer, sidebar, etc). You can also create and configure new blocks. \r\n\r\nIn the Administration menu go to Structure > Blocks. Click ''Add block'' to create a new block or go to the list of available blocks below, where the disabled ones are located at the bottom. \r\n\r\nThe ''configure'' link takes you to screen where you can customize the appearance of your block, add title and content. After you''ve finished with settings click ''Save block'' at the bottom of the page. \r\n\r\nYou can assign a few blocks to the same region, and define the higher/lower position of each by moving them in the list of blocks. When done, click the ''Save blocks'' button at the bottom of the page.', '', 'full_html'),
