(55, 'node', ' block regions on this page you see various blocks in different positions on the page blocks are the boxes of content for example recent comments latest news search form etc that can be displayed on the page in different regions header footer sidebar etc according to your settings different blocks become available when you enable certain modules for example with forum module you have new forum topic with blog module recent blog posts and so on when you enabled a block you can assign pages on which the block will be appearing and also set its position on the page header footer sidebar etc you can also create and configure new blocks in the administration menu go to structure blocks click add block to create a new block or go to the list of available blocks below where the disabled ones are located at the bottom the configure link takes you to screen where you can customize the appearance of your block add title and content after you ve finished with settings click save block at the bottom of the page you can assign a few blocks to the same region and define the higher lower position of each by moving them in the list of blocks when done click the save blocks button at the bottom of the page  ', 0),
